n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"944307","type":"CustomJS"},{"attributes":{"fill_color":"#ffffea","line_color":"#ffcb66","x":{"field":"index"},"y":{"field":"equity_dd"}},"id":"943962","type":"Patch"},{"attributes":{},"id":"944095","type":"ResetTool"},{"attributes":{"line_alpha":{"value":0.2},"line_color":{"field":"returns_positive","transform":{"id":"943924"}},"line_dash":{"value":"dotted"},"line_width":{"value":8},"xs":{"field":"position_lines_xs"},"ys":{"field":"position_lines_ys"}},"id":"944197","type":"MultiLine"},{"attributes":{},"id":"943990","type":"UnionRenderers"},{"attributes":{"axis":{"id":"944086"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"944089","type":"Grid"},{"attributes":{"overlay":{"id":"944097"}},"id":"944092","type":"BoxZoomTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP6JoNVyYsO8/fnDAb1Xf7z/OyE7mpa/vPxPf5pxQIPA/U2gQGB418D9LjYVkcTzwPxquN5SKEPA/jw1sDHX67z+mT041ewzvP7RoBS2rUO8/EJUtSy1x7j8koYUxr43uP7mwZU2tee4/4wB/YVRh7j8S68t0x63uPxQJ3jTYpu4/c7IiedKS7j//eTCE/OLuP77Kyhmvje4/kmGWlBBx7j8DU4D9fW7uPxToc8vzk+0/oZkvO0O07T9CqUjq1j3tP47LXvKMDO0/ROfGFHhj7D88p9GhK3fsP1INfBcUIOw/Y+VjltpV7D/7x9wdninsP2lQzkf0J+w/gV6ksQgi7D/wJ2dISNTrP/9bGPfv1us/iFDLT0AQ7D9IDoawHEXsP10KyYVoIe0/BUqMdZz97D8q74W0c9/rP0o
